import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 8.01-525.12 Clerk to preserve assignment; fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-525.12.md","filePath":"vacode/8.01-525.12.md"}'),s={name:"vacode/8.01-525.12.md"},n=r('<h1 id="§-8-01-525-12-clerk-to-preserve-assignment-fees" tabindex="-1">§ 8.01-525.12 Clerk to preserve assignment; fees. <a class="header-anchor" href="#§-8-01-525-12-clerk-to-preserve-assignment-fees" aria-label="Permalink to &quot;§ 8.01-525.12 Clerk to preserve assignment; fees.&quot;">​</a></h1><p>The clerk of the court wherein any assignment is filed, as otherwise provided by law, shall maintain the court records of such assignment, together with all reports of the trustee, and shall keep an index of all such assignments. For filing the assignment, the fee as prescribed in § <a href="/vacode/17.1-275/">17.1-275</a> shall be charged.</p><p>1936, p. 524; Michie Code 1942, § 5278j; Code 1950, § 55-167; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0432" target="_blank" rel="noreferrer">432</a>; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),i=[n];function o(l,c,h,_,d,p){return t(),a("div",null,i)}const m=e(s,[["render",o]]);export{g as __pageData,m as default};
